import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar/Navbar.js';
import React,{useState,useEffect} from 'react';

function App() {
  const [banana,setbanana] = useState("Hay");

  return (
    <div>
      <div className="App">
        <Navbar valore1={banana} valore2={"No Dio Cane"} funzione={setbanana}/>
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {banana}
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    </div>
  );
}

export default App;
